import React, { useState } from 'react';
import Link from 'next/link';

import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem,
  NavbarText
} from 'reactstrap';

const NavigationBar = (props) => {
  const [isOpen, setIsOpen] = useState(false);

  const toggle = () => setIsOpen(!isOpen);

  return (
      <Navbar className="navigationbar" color="light" light expand="md" fixed={'top'}>
        <NavbarToggler  onClick={toggle} />
        <Collapse isOpen={isOpen} navbar>
          <Nav className="mr-auto" navbar>
            <NavItem>
              <Link href="/"><NavLink style={{fontFamily: 'Roboto', fontSize: '30px', padding: '1rem'}}  className="test" href="/">Home</NavLink></Link>             
            </NavItem>
            <NavItem>
              <Link href="/projects"><NavLink style={{fontFamily: 'Roboto', fontSize: '30px', padding: '1rem'}} href="/projects">Projects</NavLink></Link>             
            </NavItem>
          </Nav>
        </Collapse>
        <style jsx>{`
          .test {
            color:red;
          }
        `} </style>
      </Navbar>
  );
}

export default NavigationBar;
